import React from "react";
import Navbar from "./Navbar";

function CreateBlog() {
  return (
    <>
      <div>
        <Navbar />
      </div>
      <div class="container">
        <div class="row">
            <div class="col-6"></div>
        </div>
      </div>
      <div>
        <h3>Create Blog</h3>
      </div>
    </>
  );
}

export default CreateBlog;
